import logo from "../assets/imagenes/logo.svg";
import { NOMBRETIENDA } from "./CONST.js";


const nombre = Constants.NOMBRETIENDA;

function Header() {
	return (
		<header>
			<img src={logo} alt={nombre} />
			<p>{NOMBRETIENDA}</p>
		</header>
	)
}
export default Header;
